import React, { useState } from "react";
import styles from './Place.module.css';
import Carousel from "./Carousel/Carousel.js";
import QrList from "./Qrpage/Qrpage.js"
import ProfileHeader from "./ProfileHeader/ProfileHeader.js"

const place = [{
    id: 545,
    name: "Pueblo Limite",
    subscriber: false,
    status: "owner",
    location: "Av. Brasil 2020",
    description: "Boliche para pasarla espectacular",
    products: {
        "Combos": [{
            id: "1",
            prod_name: "Combo Absolute",
            price: 15000,
            img: "place.jpeg"
        }],
        "Sin Alcohol": [{
            id: "2",
            prod_name: "Botella Agua",
            price: 1000,
            img: "place.jpeg"
        }, {
            id: "5",
            prod_name: "Coca Cola",
            price: 1000,
            img: "place.jpeg"
        },
        {
            id: "6",
            prod_name: "Speed",
            price: 1000,
            img: "place.jpeg"
        }],
        "Espumantes": [{
            id: "3",
            prod_name: "Baron B",
            price: 20000,
            img: "place.jpeg"
        }, {
            id: "4",
            prod_name: "Chandon",
            price: 15000,
            img: "place.jpeg"
        }],
        "Artesanal": [{
            id: "2",
            prod_name: "Honey",
            price: 1000,
            img: "place.jpeg"
        }, {
            id: "5",
            prod_name: "Ipa",
            price: 1000,
            img: "place.jpeg"
        },
        {
            id: "6",
            prod_name: "Negra",
            price: 1000,
            img: "place.jpeg"
        }]
    }
}]

const user = {
    nombre: "Sebastian",
    saldo: 15000,
    qrckets_activos: [{
        codigoqr: "dedkeofoefjofj",
        codigo: "abcdg",
        color: "#fff",
        nombre: "Botella Agua"
    },
    {
        codigoqr: "sfseofkspeofksekfs",
        codigo: "abcde",
        color: "#ffg",
        nombre: "Combo Absolut"
    },
    {
        codigoqr: "selkfsefmsfsfofs",
        codigo: "afcde",
        color: "#gfg",
        nombre: "Chandon Delice"
    }
    ],
    qrckets_usados: [{
        codigoqr: "aebtrerrebrtrbt",
        codigo: "abcdbg",
        color: "#fff",
        nombre: "Combo Smirnoff"
    },
    {
        codigoqr: "areretertgrtu",
        codigo: "abdccde",
        color: "#ffg",
        nombre: "Speed"
    },
    {
        codigoqr: "grtsryreyrtuyi",
        codigo: "dddd",
        color: "#gfg",
        nombre: "Imperial Ipa"
    }
    ]
}



function Store( { id }) {

    /* Aca deberia hacer un fetch a la api de sucursales con la id: id */
    const products = place.products;

    return (
        <div className={styles.store}>
            {Object.keys(products).map((prod_cat, idx) => <div key={idx} className={styles.category_card} >
                <p>{prod_cat}</p>
                <Carousel products={products[prod_cat]} />
            </div>)}
        </div>
    );
}


class QrPage extends React.Component {
    render() {
        return (
            <div className={styles.qr_page}>
                <QrList qrs={user.qrckets_activos} state={"active"} />
            </div>
        );
    }

}

function Place() {
    const [store, setStore] = useState(true);
    const radioChange = (e) => {
        e.target.value === 'store' ?
            setStore(true)
            :
            setStore(false);
    }

    return (
        <div>
            <ProfileHeader user={user} />
            <div className={styles.place_header}>
                <div className={styles.place_header_profile}>
                    <img src="place.jpeg" alt="PuertoNorte" />
                    <div>
                        <p>{place.name}</p>
                        {!place.subscriber ? <button type="button" className="btn btn-danger">Suscribirse</button> :
                            <button type="button" className="btn btn-primary">Suscripto</button>}

                    </div>
                </div>
                <div className={styles.place_options}>
                    <label className={styles.place_options_label} onChange={radioChange} >
                        <input type="radio" name="place" value="store" defaultChecked />
                        Store
                        <div className={styles.place_options_line} />
                    </label>
                    <label className={styles.place_options_label} onChange={radioChange}>
                        <input type="radio" name="place" value="qrckets" />
                        Qrckets
                        <div className={styles.place_options_line} />
                    </label>
                </div>
            </div>
            <div className={styles.place_options}>
                {store ?
                    <Store id={place.id} />
                    :
                    <QrPage place_id={place.id} user_id={user.id}/>}
            </div>
        </div>
    );
}

export default Place;
